import './contacts.css'


const asideInformation = [
    {
        title: "КИНОТЕАТР &laquo "
    }
]

export function ContactsPage (){
    return(
        <section className="contactsSection">
            <h2 className='contactsSection__title'>Сотрудники киноклуба «Москва» будут рады ответить на все интересующие вопросы, связанные с работой кинотеатра и ресторанов</h2>
            <AsideContacts>
                <article className="contacts__article">
                    <aside className="contacts__aside">
                        <p className="contacts__title"></p>
                        <p className="contacts__number"></p>
                        <p className="contacts__description"></p>
                    </aside>
                </article>
            </AsideContacts>
        </section>
    )
}
